import styled from 'styled-components'

export const StyledDetailPage = styled.div`
    height: 100vh; 
    display: flex; 
    flex-direction: column; 
    justify-content: center; 
    align-items: center; 

    

    div{
        width: 400px; 
        margin: 20px 0px; 
    }
    td{
        padding-left: 80px; 
    }
`
